import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <section id="home" className="home">
      <div className="home-content">
        <img src={`${process.env.PUBLIC_URL}/profile.jpg`} alt="Dr. Amudhesh Sankaran" className="profile-image"/>
        <div className="home-text">
          <h1>Welcome to My Portfolio</h1>
          <p>Dr. Amudhesh Sankaran - Dedicated to Excellence in Healthcare</p>
        </div>
      </div>
    </section>
  );
};

export default Home;
